var deviareApp=angular.module("deviareApp",[]);deviareApp.controller("mainController",["$scope","$http",function(e,r){"use strict";e.redirectData={},e.redirects={},r.get("api/redirects").success(function(r){e.redirects=r,console.log(r)}).error(function(e){console.log("Error: "+e)}),e.createRedirect=function(){r.post("/api/redirects",e.formData).success(function(r){e.formData={},e.redirects=r,console.log(r)}).error(function(e){console.log("Error: "+e)})},e.deleteRedirect=function(o){r.delete("/api/redirects/"+o).success(function(r){e.redirects=r,console.log(r)}).error(function(e){console.log("Error: "+e)})}}]);